//read Csv columns without header
// read the csv file 
readfile = new BufferedReader( new FileReader("C:\\Users\\Admin\\Desktop\\SOAPUi\\Numbers.csv"))
//read each line in the csv file 
retData =readfile.readLine()//firstline

Temp =0
// Go in a loop and read each line of the csv file and feed this to the int A and int B  of the test case
while (retData != null)
{
	//ignore line number 0 i.e first row in the csv file
	if (Temp==0)
	{
		retData=readfile.readLine()
		Temp++
	}
	String[] inputdata =retData.split(',')
	log.info inputdata[0]
	log.info inputdata[1]
	context.setProperty("intA",inputdata[0])
	context.setProperty("intB",inputdata[1])
	RunAdd =testRunner.testCase.testSteps["AddPositiveNumbers"]
	RunAdd.run(testRunner,context)
	retData=readfile.readLine()
}

